import React, { isValidElement } from 'react'

const SearchCard = ({val}) => {
   console.log((val.language) !==[].length);
  return (
    <div className="cardContainer">
        <div className="coverImage">
            <img src={`https://covers.openlibrary.org/b/olid/${val.edition_key[0]}.jpg`} alt='val.title' />
        </div>
        <div className="bookDetails">
            <li>{val.title}</li>
            <li>by { " "+val.author_name } </li>
            <li><span>First published in { val.first_publish_year }</span> </li>
            <li><span> { val.edition_count } editions in  languages</span> </li>
        </div>
        <div className="actions"></div>
    </div>
  )
}

export default SearchCard;
